import { Button } from '@material-ui/core';
import React from 'react';
const Home = (()=>{

    return (
        <>
        <div className="Home">
            <h1>This is Home page</h1>
            <Button>Books</Button>
            <Button>Add</Button>
            <Button>Update</Button>
            </div>
        </>
    )
})
export default Home
